      <Link to="/users">
          <button style={{marginRight: "15px"}} className="button is-white">Users</button>
        </Link>
        <Link to="/search">
          <button style={{marginRight: "15px"}} className="button is-white"><BsSearch/></button>
        </Link>
      </div>
    </nav>
      </div>
  );
};

export default Navbar;
